import React from 'react';
import SocialIcons from './Sociallcons.js';


const Nav = ({ links, switchContent, activeLink }) => {
  return (
    <div className="side-nav">
      {links.map(link => (
        <a
          key={link.id}  
          href="#"
          onClick={(e) => {
            e.preventDefault();
            switchContent(link.id);
          }}
          className={activeLink === link.id ? 'clink active' : 'clink'}
         >
           {link.text}
         </a>
       ))}
       <SocialIcons />
    </div>
  );
}

export default Nav;
